import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import './main2.css'

const Main3 =()=>{
    return(
        <div>
        <article className="vh-100 dt w-100 bg-dark-pink">
        <div className="dtc v-mid tc white ph3 ph4-l">
        <article className="mw6 center bg-white br3 pa3 pa4-ns mv3 ba b--black-10 shadow-3">
        <Container fluid>
            <Row>
                <Col className='col-md-12'>
                    <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6bvJmzMKT53f1uZYSIbw38ufxVrwU4QegXA&usqp=CAU' width={'150px'}/>
                </Col>
            </Row>
        </Container>
        </article>
        </div>
        </article>
    </div>
    )
}  

export default Main3
